  function init() {
    document.addEventListener('mousemove', mousemove);
    setInterval(loop, 1000 / fps);
  }

  function mousemove(e) {
    mouse = { x: e.clientX, y: e.clientY };
  }

  function loop() {
    for (var i = 0; i < parts.length; i++) {
      var params = { mouse: mouse, part: parts[i] };
      setTimeout(transform, parts[i].z * delay, params);
    }
    element.innerHTML = svg();
  }

  function svg() {
    var svg =
      '<svg color-interpolation-filters="sRGB" style="fill-rule: evenodd; pointer-events: none; -moz-user-select: none; width: 100%; height: 100%;">';
    for (var i = 0; i < parts.length; i++) {
      svg +=
        '<g transform="matrix(0.05 0 0 0.05 ' +
        parts[i].x +
        ' ' +
        parts[i].y +
        ')">';
      svg += parts[i].data;
      svg += '</g>';
    }
    svg += defs;
    svg += '</svg>';
    return svg;
  }

  function transform(params) {
    params.part.x =
      definemaxspeed(params.mouse.x - params.part.x) / easy + params.part.x;
    params.part.y =
      definemaxspeed(params.mouse.y - params.part.y) / easy + params.part.y;
  }

  function definemaxspeed(speed) {
    if (speed > 0 && speed > maxspeed) return maxspeed;
    if (speed < 0 && speed < -maxspeed) return -maxspeed;
    return speed;
  }

  return { init: init };
